import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component{


  constructor(props){
    super(props);
    this.state = {
      name: 'Pedro Henrique'
    };

  }

  render(){


    const nome = this.stage.nome;

    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            {nome}
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }

  }



  /*

*/

export default App;
